import React from 'react';
import '../estilos/FiltrosBarra.css';

export const FiltrosBarra = () => {
    return (
        <div className="filtros-barra">
            <div>
                <h3>SUPERMERCADOS</h3>
                <select>
                    <option value="">Seleccione un supermercado</option>
                    <option value="Walmart">Walmart</option>
                    <option value="Bodega Aurrera">Bodega Aurrera</option>
                    <option value="Ley">Ley</option>
                </select>
            </div>
            <div>
                <h3>CATEGORÍA</h3>
                <select>
                    <option value="">Seleccione una categoría</option>
                    <option value="abarrotes">Abarrotes</option>
                    <option value="frutas_y_verduras">Frutas y Verduras</option>
                    <option value="snacks">Snacks</option>
                </select>
            </div>
        </div>
    );
};
